// client/src/components/PaymentPage.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './payments.css';
import { FaDownload, FaCheck } from 'react-icons/fa';

const PaymentPage = () => {
    const [products] = useState([
        { id: 1, name: 'CSE110', price: 22000.00, description: 'Introduction to Programming' },
        { id: 2, name: 'CSE111', price: 22000.00, description: 'Object-Oriented Programming' },
        { id: 3, name: 'CSE112', price: 22000.00, description: 'Data Structures' }
    ]);
    const [selectedItems, setSelectedItems] = useState([]);
    const [total, setTotal] = useState(0);

    useEffect(() => {
        const calculatedTotal = selectedItems.reduce((sum, item) => sum + item.price, 0);
        setTotal(calculatedTotal);
    }, [selectedItems]);

    const handleCheckboxChange = (productId) => {
        setSelectedItems(prevItems => {
            const existingItem = prevItems.find(item => item.id === productId);
            if (existingItem) {
                return prevItems.filter(item => item.id !== productId);
            } else {
                const product = products.find(p => p.id === productId);
                return [...prevItems, product];
            }
        });
    };

    const generateReceipt = () => {
        const receiptContent = `
            ╔══════════════════════════════╗
            ║        PAYMENT RECEIPT       ║
            ╠══════════════════════════════╣
            ║ ${new Date().toLocaleDateString()} ${new Date().toLocaleTimeString()} ║
            ╟──────────────────────────────╢
            ${selectedItems.map(item => 
                `║ ${item.name.padEnd(8)} $${item.price.toFixed(2).padStart(10)} ║\n` +
                `║ ${item.description.padEnd(28)} ║`
            ).join('\n╟──────────────────────────────╢\n')}
            ╟──────────────────────────────╢
            ║ TOTAL      $${total.toFixed(2).padStart(10)} ║
            ╚══════════════════════════════╝
            Thank you for your payment!
        `;

        const blob = new Blob([receiptContent], { type: 'text/plain' });
        const url = URL.createObjectURL(blob);
        const link = document.createElement('a');
        link.href = url;
        link.download = `receipt_${new Date().getTime()}.txt`;
        document.body.appendChild(link);
        link.click();
        document.body.removeChild(link);
        URL.revokeObjectURL(url);
    };

    return (
        <div className="payment-container">
            <div className="payment-card">
                <h2 className="payment-title">Course Payment</h2>
                <p className="payment-subtitle">Select the courses you want to enroll in</p>
                
                <div className="courses-list">
                    {products.map(product => (
                        <div 
                            key={product.id} 
                            className={`course-item ${selectedItems.some(item => item.id === product.id) ? 'selected' : ''}`}
                            onClick={() => handleCheckboxChange(product.id)}
                        >
                            <div className="course-checkbox">
                                {selectedItems.some(item => item.id === product.id) && <FaCheck className="check-icon" />}
                            </div>
                            <div className="course-details">
                                <h3 className="course-name">{product.name}</h3>
                                <p className="course-description">{product.description}</p>
                            </div>
                            <div className="course-price">${product.price.toFixed(2)}</div>
                        </div>
                    ))}
                </div>

                <div className="payment-summary">
                    <div className="total-amount">
                        <span>Total Amount:</span>
                        <span className="amount">${total.toFixed(2)}</span>
                    </div>
                    <button 
                        onClick={generateReceipt} 
                        disabled={total <= 0}
                        className="download-btn"
                    >
                        <FaDownload className="download-icon" />
                        Download Receipt
                    </button>
                </div>
            </div>
        </div>
    );
};

export default PaymentPage;
